import React from 'react'

export const GlobalFilter = ({ filter, setFilter, columnFilters }) => {
    return (
      <div className="bg-white rounded-lg w-2/12 p-8 shadow-lg w-60 py-2 place-items-start mx-4">
        <h1 className="py-2 text-gray-800 font-bold">Фильтры</h1>
        <input
          value={filter || ''}
          onChange={e => setFilter(e.target.value)}
          placeholder="Глобальный поиск"
          className="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 mb-3 leading-tight focus:outline-none focus:shadow-outline"
        />
        {columnFilters.map((column, index) => (
          <ColumnFilter key={index} column={column} />
        ))}
      </div>
    );
  };
